/* eslint-disable no-else-return */
/* eslint-disable no-console */
import passport from 'passport';
import routes from '../routes';
import User from '../models/User';



export const getJoin = (req, res) => {
    res.render('join', { pageTitle: 'Join' });
};

export const postJoin = async (req, res, next) => {
    const {
        body: {
            name, email, password, password2, 
        },
    } = req;
    if (password !== password2) {
        res.status(400);
        res.render('join', { pageTitle: 'Join' });
    } else {
        try {
            const user = await User({
                name,
                email,
            }); // User Create  .        User . 
            await User.register(user, password);
            next();
        } catch (error) {
            console.log(error);
            res.redirect(routes.home);
        }
    }
};


export const getLogin = (req, res) => res.render('login', { pageTitle: 'Login' });

export const postLogin = passport.authenticate('local', { 
    failureRedirect: routes.login,
    successRedirect: routes.home,
});


export const githubLogin = passport.authenticate('github');

export const postGithubLogin = (req, res) => {
    res.redirect(routes.home);
};

export const logout = (req, res) => {
    console.log('logout prcessed');
    req.logout();
    res.redirect(routes.home);
};

export const githubLoginCallback = async (accessToken, refreshToken, profile, cb) => {
    console.log(profile);
    const {
        _json: {
            id, avatar_url: avatarUrl, name, email,
        },
    } = profile;

    try {
        const user = await User.findOne({ email });
        console.log(user);
        if (user) {
            user.githubId = id;
            user.avatarUrl = avatarUrl;
            user.save();
            return cb(null, user);
        } 
        const newUser = await User.create({
            email,
            name,
            githubId: id,
            avatarUrl,
        });
        return cb(null, newUser);
    } catch (error) {
        return cb(error);
    }
};

export const facebookLogin = passport.authenticate('facebook');

export const facebookLoginCallback = async (acessToken, refreshToken, profile, cb) => {
    const {
        _json: {
            id, name, email,
        },
    } = profile;
    try {
        const user = await User.findOne({ email });
        console.log(user);
        if (user) {
            user.facebookId = id;
            user.save();
            return cb(null, user);
        }
        const newUser = await User.create({
            email,
            name,
            facebookId: id,
            avatarUrl: `https://graph.facebook.com/${id}/picture?type=large`,
        });
        return cb(null, newUser);
    } catch (error) {
        return cb(error);
    }
};

export const postFacebookLogin = (req, res) => {
    res.redirect(routes.home);
};

// kakao Logic
export const kakaoLogin = passport.authenticate('kakao');

export const kakaoLoginCallback = async (accessToken, refreshToken, profile, done) => {
    const { username, id } = profile;
    const {
        _json: {
            properties: {
                profile_image: avatarUrl,
            },
            kakao_account: {
                email,
            },
        }, 
    } = profile;

    try {
        const user = await User.findOne({ email });
        if (user) {
            user.kakaoId = id;
            user.avatarUrl = avatarUrl;
            user.save();
            return done(null, user);
        }
        const newUser = await User.create({
            email,
            name: username,
            kakaoId: id,
            avatarUrl,
        });
        return done(null, newUser);
    } catch (error) {
        console.log(`kakao login error: ${error}`);
        return done(error);
    }
};

export const postKakaoLogin = (req, res) => {
    res.redirect(routes.home);
};

export const getMe = (req, res) => {
    res.render('userDetail', { pageTitle: 'User Detail', user: req.user });
};


export const userDetail = async (req, res) => {
    const { params: { id } } = req;
    console.log(`param id: ${id}`);
    try {
        const user = await User.findById(id).populate('videos');
        console.log('user:', user);
        res.render('userDetail', { pageTitle: 'User Detail', user });
    } catch (error) {
        console.error(error);
        res.redirect(routes.home);
    }
};

export const getEditProfile = (req, res) => res.render('editProfile',
    { pageTitle: 'Edit Profile' });

export const postEditProfile = async (req, res) => {
    const {
        body: { name, email },
        file,
    } = req;
    try {
        await User.findByIdAndUpdate(req.user.id, { 
            name,
            email,
            avatarUrl: file ? file.location : req.user.avatarUrl,
        });
        res.redirect(routes.me);
    } catch (error) {
        res.redirect(routes.editProfile);
    }
};

export const users = (req, res) => res.render('users', { pageTitle: 'Users' });
    
export const getChangePassword = (req, res) => {
    res.render('changePassword', { pageTitle: 'Change Password' });
};

export const postChangePassword = async (req, res) => {
    const {
        body: {
            oldPassword,
            newPassword,
            newPassword1,
        },
    } = req;

    try {
        if (newPassword !== newPassword1) {
            res.status(400);
            res.redirect(routes.changePassword);
            return;
        }
        await req.user.changePassword(oldPassword, newPassword);
        res.redirect(routes.me);
    } catch (error) {
        res.status(400);
        res.redirect(routes.changePassword);
    }
};

