/* eslint-disable no-shadow */
/* eslint-disable no-console */
/* eslint-disable no-empty */
/* eslint-disable indent */
/* eslint-disable no-tabs */
/* eslint-disable no-underscore-dangle */
import routes from '../routes';
import Video from '../models/Video';
import Comment from '../models/Comment';

export const home = async (req, res) => {
    try {
        const videos = await Video.find({}).sort({ _id: -1 });
        console.log('req.user: ', req.user);
        res.render('home', { pageTitle: 'Home', videos }); // try done.
    } catch (error) {
        console.error(error);
        res.render('home', { pageTitle: 'Home', videos: [] });
    }
};


export const search = async (req, res) => {
    const {
        query: { term: searchingBy },
    } = req;

    let videos = [];

    try {
    videos = await Video.find({ 
        title: { $regex: searchingBy, $options: 'i' },
    });
    } catch(err) {
    console.log(`search  : ${err}`);
    }
    res.render('search', { pageTitle: 'Search', searchingBy, videos });
};


// videoRouter.js
export const video = (req, res) => res.render('videos', { pageTitle: 'Videos' });

export const getUpload = (req, res) => res.render('upload', { pageTitle: 'Upload' });

export const postUpload = async (req, res) => {
    console.log('upload post');
    const {
        body: { title, description },
        file: { location },
    } = req;
    console.log(req.file);
    const newVideo = await Video.create({
        fileUrl: location,
        title,
        description,
        creator: req.user.id,
    });
    req.user.videos.push(newVideo._id);
    req.user.save();
    res.redirect(routes.videoDetail(newVideo._id));
    // To Do : Upload and save video
};


// Video Detail
export const videoDetail = async (req, res) => {
    const {
        params: { id },
    } = req;
    try {
        const video = await (await Video.findById(id)
        .populate('creator')
        .populate('comments'));
        console.log(`finded Video: ${video}`);
        res.render('videoDetail', { pageTitle: `${video.title} | DDCtube`, video });
    } catch (error) {
        console.log(error);
        res.redirect(routes.home);
    }
};


export const getEditVideo = async (req, res) => {
    const {
        params: { id },
    } = req;
    try {
        const video = await Video.findById(id);
        if (video.creator.id !== req.user.id) {
            throw Error();
        } else {
            res.render('editVideo', { pageTitle: 'Edit Video', video });
        }
    } catch (error) {
        console.error(error);
        res.redirect(routes.home);
    }
};


export const postEditVideo = async (req, res) => {
    const {
        params: { id },
        body: { UpdateTitle, UpdateDescription },
    } = req;
    try {
        await Video.findOneAndUpdate({ _id: id }, 
        { title: UpdateTitle, description: UpdateDescription }, 
        () => {
            console.log(`${id}   .`);
        });
        res.redirect(routes.videoDetail(id));
    } catch (error) {
        res.redirect(routes.home);
    }
};


export const deleteVideo = async (req, res) => {
    const {
        params: { id },
    } = req;

    try {
        const video = await Video.findById(id);
        if (video.creator.id !== req.user.id) {
            throw Error();
        } else {
            await Video.findOneAndDelete({ _id: id }, () => { console.log(`${id}  .`); });
        }
    } catch (err) {
        console.error(`deleteVideo  : ${err}`);
    }
    res.redirect(routes.home);
};


//
export const postRegisterView = async (req, res) => {
    const {
        params: { id },
    } = req;
    try {
        const video = await Video.findById(id);
        video.views += 1;
        video.save();
        res.status(200);
    } catch (error) {
        res.status(400);
    } finally {
        res.end();
    }
};

export const postAddComment = async (req, res) => {
    const {
        params: { id },
        body: { comment },
        user,
    } = req;
    console.log('postAddComment: ', comment);
    try {
        const video = await Video.findById(id);
        const newComment = await Comment.create({
            text: comment,
            creator: user.id,
        });
        console.log(newComment);
        video.comments.push(newComment._id);
        video.save();
    } catch (error) {
        res.status(400);
    } finally {
        res.end();
    }
};

export const postDeleteComment = async (req, res) => {
    const {
        params: { id },
        user,
    } = req;

    try {
        const video = await Video.findById(id);
        
    } catch (error) {

    }
}

